import React, { Component } from 'react';
class ListCards extends Component {
    state = {  }
    
    render() { 
        const mosnters=this.props.children
        // .map((mosnter)=><h1 key={mosnter.id}>{mosnter.name}</h1>
        return ( 
            <>            
            mosnters.map((mosnter)=><h1 key={mosnter.id}>{mosnter.name}</h1>
            </>
         );
    }
}
 
export default ListCards;
